import React from 'react';
import {Link } from 'react-router-dom';
import Intention_Logo from './Intention_Logo.png';



const NavComponent = () => {
return (
<nav className="nav-extended">
    <div className="nav-wrapper">
    <div className="row">
    <img src={Intention_Logo} className="nav-logo brand-logo center" alt="Send Healing"></img><Link to="/home" className="brand-logo center" ></Link><img src={Intention_Logo} className="nav-logo brand-logo center" alt="Send Healing"></img>
    </div>
    <div className="row">
    </div>
    <div className="row">
            <div className="nav-content center">
                <ul className="tabs tabs-transparent center">
                    <li className="tab"><Link to="/" >Healing Circle</Link></li>
                    <li className="tab"><Link to="/create" >Heal Request</Link></li>
                    <li className="tab"><Link to="/user" >Create Healer</Link></li>
                    <li className="tab"><Link to="/instructions" >Instructions</Link></li>
                </ul>
            </div>
    </div>
    </div>    
</nav>

);

};

export default NavComponent;
